import Table from './components/Tables/tables'
import './App.css';

class App extends React.Component{
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <p className ="table">
           <Table/>
          </p>
          <button onClick={console.log("Hi")}>
            Activate Lasers
          </button>
        </header>
      </div>

    );
  }
}

export default App;
